                    <Col sm={12} md={6} lg={4} xl={4}>
                      {product.name}
                      {product._id}
                    </Col>
                })}
           <Container>
           <h2>Latest Products</h2>
            <Row>
                
            </Row>
           </Container>
        </>
    )
}

export default HomeScreen
